import './card.css';
import React from 'react';

const countries = [{
  name: 'Norway',
  capital: 'Oslo',
  flags: 'https://flagcdn.com/w320/no.png',
  languages: 'Norwegian',
  currencies: 'Norwegian crone',
  id: 1,
},
{
  name: 'Italy',
  capital: 'Rome',
  flags: 'https://flagcdn.com/w320/it.png',
  languages: 'Italy',
  currencies: 'euro',
  id: 2,
},
]

export default class Card extends React.Component {
  render() {
    return (
        <div className="container">
            <img src={this.props.data.flags} className="country__flag"/>
            <h3 className="country__name">
              {name}
            </h3>
            <h4 className="country__capital">
              {capital}
            </h4>
            <p className="country__lang">
              Languages: {lang}
            </p>
            <p className="country__currency">
              {currency}
            </p>
        </div>
    )
  }
  
};
